import React from 'react';
import Navigation from './Navigation';
import ImageGallery from 'react-image-gallery';

import './style.css';

var images = [];

for (var i = 0; i < 110; i++) {
    var pagePath = './pages/' + i.toString() + '.jpg';
    var thumbnailPath = './thumbnails/' + i.toString() + '.jpg';

    images.push({ original: pagePath, thumbnail: thumbnailPath});
}

console.log(images);

const images2 = [
    {
        original: 'headShot.jpg',
        thumbnail: 'headShot.jpg'
      },
      {
        original: 'brick.jpg',
        thumbnail: 'brick.jpg'
      },
      {
        original: 'twitter-logo.png',
        thumbnail: 'twitter-logo.png'
      }
]

class App extends React.Component {

    render() {
        return (
            <div>
                <Navigation />
                <div className="background-home">
                    <br />
                    <br />
                    <ImageGallery items={images} />
                </div>
            </div>
        );
    };
}

export default App;
